// src/js/Nav.js

import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav className="navbar">
            <div className="logo">MyAppLogo</div>
            <ul className="nav-links">
                <li>
                    <Link to="/">HOME</Link>
                </li>
                {/* Add more links as needed */}
            </ul>
        </nav>
    );
}

export default Nav;
